import React, { ReactNode } from "react";
import ReactDOM from "react-dom";

type ModalProps = {
  children: ReactNode;
};

const Modal: React.FC<ModalProps> = ({ children }) => {
  return ReactDOM.createPortal(children, document.getElementById("root")!);
};

export default Modal;
